import React from 'react';
import AppointmentUpdateForm from '../components/AppointmentUpdateForm'



class Appointment extends React.Component {

    state = {
        editForm: false
    }

    selectRender = () => {
        // console.log("i am from Appointment", props)
        if (this.props.findLeadName) {
            return <li>{`${this.props.appointment.title} with ${this.props.findLeadName(this.props.appointment.lead_id)}`}</li>
        } else {
            return (
            <h3>{this.props.appointment.title}</h3>
            )
        }
    }


    render () {
        return (
            <div className="appointment">
                {this.selectRender()}
            </div>
        )
    }
}

export default Appointment;
